index.css:
.fab-position-container {
    position: relative;
    min-height: 310px;
}
.custom-index {
    z-index: 500 !important;
}

/* Represents the styles for icon */
@font-face {
    font-family: 'fab-icons';
    src: url(data:application/x-font-ttf;charset=utf-8;base64,) format('truetype');
    font-weight: normal;
    font-style: normal;
}

[class^="fab-icon-"],
[class*=" fab-icon-"] {
    font-family: 'fab-icons' !important;
    speak: none;
    font-size: 55px;
    font-style: normal;
    font-weight: normal;
    font-variant: normal;
    text-transform: none;
    line-height: inherit;
    -webkit-font-smoothing: antialiased;
    -moz-osx-font-smoothing: grayscale;
}

.fab-icon-people:before {
    content: "\e70a";
}

